'use client'
import { useEffect, useState } from "react";
import "./style.scss"; // Import your styles

const Interactive = () => {
  const [activeIndex, setActiveIndex] = useState(null);
  const [containerActive, setContainerActive] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => setContainerActive(true), 200);
    return () => clearTimeout(timer);
  }, []);

  const handleClick = (index: any) => {
    if (activeIndex === index) return;
    setActiveIndex(index);
  };

  const handleClose = (e: any) => {
    e.stopPropagation();
    setActiveIndex(null);
  };

  const sections = [
    "Section 1",
    "Section 2",
    "Section 3",
    // "Section 4",
    // "Section 5",
  ];

  const content = [
    "Section 1",
    "Section 2",
    "Section 3",
    // "Section 4",
    // "Section 5",
  ];


  const media = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    // "Section 4",
    // "Section 5",
  ];

  return (
    <div className="">
      <div className={`cont ${containerActive ? "" : "s--inactive"} ${activeIndex !== null ? "s--el-active" : ""}`}>
        <div className="cont__inner">
          {sections.map((section, index) => (
            <div
              key={index}
              className={`el ${activeIndex === index ? "s--active" : ""}`}
              onClick={() => handleClick(index)}
            >
              <div className="el__overflow">
                <div className="el__inner">
                  <div className="el__bg"></div>
                  <div className="el__preview-cont">
                    <h2 className="el__heading">{section}</h2>
                  </div>
                  <div className="el__content overflow-scroll mx-auto">
                    <div className="el__text">Whatever</div>
                    {/* <img src="data:image/jpeg;base64," alt="" />
                    <img src="data:image/jpeg;base64," alt="" />
                    <img src="data:image/jpeg;base64," alt="" />
                    <img src="data:image/jpeg;base64," alt="" /> */}
                    {content[index]}

                    <img src={media[index]} alt="" />

                    <div className="el__close-btn" onClick={handleClose}></div>
                  </div>
                </div>
              </div>
              <div className="el__index">
                <div className="el__index-back">{index + 1}</div>
                <div className="el__index-front">
                  <div className="el__index-overlay" data-index={index + 1}>{index + 1}</div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Interactive;
